graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_System {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>System</b></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "System__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    subgraph cluster_Frontend {
      label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Frontend</b></td></tr></table>>;
      labelloc="t";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "Frontend__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      "UI" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>UI</b></td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
      "Router" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Router</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
    }
    subgraph cluster_Backend {
      label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Backend</b></td></tr></table>>;
      labelloc="t";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "Backend__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      "API" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>API</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
      "Database" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Database</b></td></tr></table>>, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C"];
    }
  }

  // Edges
  "UI" -> "API" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "API" -> "Database" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
